'use strict';
let GetAccountCommissionsMessage = require('./GetAccountCommissionsMessage.js');
class GetAccountCommissionsMessageBuilder extends GetAccountCommissionsMessage {
    addAccountCommission(accountCommission) {
        this.accountCommissionsList.add(accountCommission);
    }
    addAccountCommissions(accountCommissions) {
        let i;
        if (accountCommissions != null) {
            for (i = 0; i <= accountCommissions.length() - 1; i += 1) {
                this.addAccountCommission(accountCommissions.get(i));
            }
        }
    }
    setAcctId(acctId) {
        this.acctId = acctId;
    }
    setOfferIds(offerIds) {
        this.offerIds = offerIds;
    }
    build() {
        return this;
    }
}
module.exports = GetAccountCommissionsMessageBuilder
